import Login from "./pages/login/Login";

import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (



  <Router>
  <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/movies">
            <Home type="movies" />
          </Route>
          <Route path="/series">
            <Home type="series" />
          </Route>

        </Switch>

</Router> 

  );
}

export default App;
